Lince GPS é um programa para sinalizar fiscalização eletrônica (pardais) e pontos perigosos. Além disso, também é um computador de bordo. Com interface fácil e intuitiva, é possível marcar pontos desejados e a velocidade máxima permitida da via. Ao se aproximar de um ponto marcado, um aviso visual o alertará da aproximação. Caso você esteja acima da velocidade, um aviso sonoro também será emitido.
Além de ser possível marcar os próprios pontos, podem-se contratar os pontos de controle de velocidade da Robotron. Pagando-se uma pequena anuidade, têm-se atualizações mensais de pontos de diversas cidades brasileiras, feitas por uma equipe de profissionais. A atualização dos pontos da Robotron é feita pelo celular com apenas alguns toques.
Instale grátis em seu iPhone e use o serviço por 7 dias.

RECURSOS:
- Alerta os pontos registrados apenas na pista trafegada: evita alarme falso.
- Ajuste de tempo de aviso: ao invés de se escolher a distância, escolhe-se o tempo para que o alerta apareça. Você sempre será avisado com a antecedência certa, independentemente da velocidade do veículo;
- Ajuste de volume do beep: É fácil conciliar o volume do aviso sonoro e o volume da sua música;
- Visualização de mapa do local onde se está trafegando. Esse recurso é opcional.

COMPUTADOR DE BORDO:
- Velocidade atual;
- Velocidade média;
- Velocidade máxima;
- Distância percorrida;
- Direção (curso);
- Dados de localização (latitude, longitude, altitude).

IMPORTANTE:
- O GPS funciona quando o iPhone está com a tela apagada;
- É necessário iPhone 3G com iPhoneOS 6.1 ou mais recente para executar o Lince GPS;
- É recomendável o uso de carregador veicular ao usar o Lince GPS, pois o sistema de GPS consome bateria rapidamente;
- Disponível apenas em Português-BR.

