Lince GPS is a software that alerts speed traps and dangerous points. It´s also a board computer. With an easy and intuitive interface, it´s possible to mark points and the track speed limit. Approaching a marked point, an visual alert will warn you. If you are above the speed limit, an audible alarm will also be sent.
In addition to use your marked points, you can contract the speed control points from Robotron. Paying a small annuity, you will have monthly updates of points from almost all places in Brazil. The updates are made in the cellular with just a few touches.

FEATURES:

-  Warn the recorded points only in your track, avoiding false alarms.
- Alert time adjustable:  instead of choosing the distance, you choose the time before the speed camera to the alert show. You will always be warned when needed, regardless of the vehicle speed.
- Sound volume control: it´s easy to harmonize the volume of the audible alarm and the volume of your music.
- View map of where you are traveling. This feature is optional.

TRIP COMPUTER:

- Current speed;
- Average speed;
- Maximum speed;
- Distance;
- Course;
- Localization data (latitude, longitude, altitude).

IMPORTANT:

- The GPS work when the iPhone is with the screen off;
- It´s necessary iPhone 3G with iPhoneOS 6.1 or more recent to use Lince GPS;
- It´s recommended the use of a car charger when using Lince GPS, because the GPS drains battery fast;
- Language: Brazilian Portuguese.

Measure the distance traveled, plot your running route, calculate the area on the map, and much more! The application is convenient to use, as there is nothing superfluous in it, so you can easily create your first route. With simple taps on the map, the app will automatically get directions. Distances and routes are calculated automatically!

The application is very simple, but it has many possibilities, here are some of them:
1. Create routes for running or walking;
2. Calculate the distance from an object to objects on the map;
3. Calculate the size of buildings, squares, roads, etc .;
4. Calculate the area of ​​territories or objects on the map;
5. Calculate the distance you covered in a day;
6. As well as other possibilities that you yourself can think of.

There are three modes in the application:
1) "Route calculation" - by placing markers on the map the application will calculate routes between them. The number of markers that you can place on the map is unlimited. You can calculate the route for walking, bike or car.
2) "Calculate distance" - calculate the distance between markers in a straight line.
3) "Calculate the area on the map" - After you set three markers on the map, the application will calculate the area of ​​this triangle. You can calculate the area of ​​almost any shape on the map.

You can use these modes in different ways, it all depends on your imagination!
